import React from "react";
import { Box, Toolbar, Typography } from "@mui/material";
// import "../styles/Projects.css";
import TitleSidebar from "../components/TitleSidebar";
import ItemCard from "../components/ItemCard";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  root: {
    display: "flex",
    flexDirection: "row",
  },
  cardContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    width: "100%",
  },
});

function Projects() {
  const classes = useStyles();
  const projects = [
    {
      id: "gridiron-gauntlet",
      title: "Gridiron Gauntlet",
      subtitle: "Game Design, Gesture Recognition, Collision Detection",
      textList: [
        "Software Methods final project.",
        "Single player iOS clone of the Super Mario Party game, Gridiron Gauntlet. The player must avoid colliding with time-scaled moving enemies within the game board bounds for as long as possible.",
        "Swift/Xcode, SpriteKit, UIKit, GameplayKit, CoreGraphics",
      ],
    },
  ];

  return (
    <Box className={classes.root}>
      <TitleSidebar title="Projects" file="projects.pdf" />
      <Box className={classes.cardContainer}>
        <Toolbar />
        {projects.map((project, i) => (
          <ItemCard
            id={`${project.id}-${i}`}
            title={project.title}
            subtitle={project.subtitle}
            textList={project.textList}
          />
        ))}
      </Box>
    </Box>
  );
}

export default Projects;
